import React, { Component } from "react";
import { log } from "util";
export default class Info extends Component {
  render() {
    return (
      <div>
        <h1>name : {this.props.data.first_name}</h1>
        <h1>email : {this.props.data.email}</h1>
        <h1>last name : {this.props.data.last_name}</h1>
        <h1>created date :{this.props.data.createdAt}</h1>
      </div>
    );
  }
}
